function showModal(
  modaltitle,
  modalcontent,
  modalimg,
  cancelContent,
  okContent,
  contentLink,
  contentLinkUrl,
  limitTime,
  okUrl,
  namespace = '',
  isForceOpen = false,
  displayAfter = 120 * 60 * 1000,
) {
  var storageKey = 'kyc-poper' + namespace
  var timer = isForceOpen ? 0 : localStorage.getItem(storageKey)
  if (timer) {
    if (Date.now() - timer < displayAfter) {
      return
    }
    localStorage.setItem(storageKey, Date.now().toString())
  } else {
    localStorage.setItem(storageKey, Date.now().toString())
  }
  var date = new Date(limitTime)
  var parsedContent = Array.isArray(modalcontent)
    ? modalcontent
        .map(
          (content, idx) =>
            `<p ${idx === modalcontent.length - 1 ? '' : 'style="margin-bottom:20px"'}>${bnvelidate.getHeaderI18n(
              content,
            )}</p>`,
        )
        .join('')
    : bnvelidate.getHeaderI18n(modalcontent)

  lockScreen()
  modalCode(
    bnvelidate.getHeaderI18n(modaltitle),
    parsedContent,
    modalimg,
    bnvelidate.getHeaderI18n(cancelContent),
    bnvelidate.getHeaderI18n(okContent),
    (contentLink && bnvelidate.getHeaderI18n(contentLink)) || undefined,
    contentLinkUrl,
    date.getFullYear() + '-' + (date.getMonth() + 1) + '-' + date.getDate(),
    okUrl,
  )
}

