const POLL_INTERVAL = 200
const POLL_TIMEOUT = 5000

// a function to execute a callback after polling a condition for a certain time
function pollAndWaitConditionGlobalIndex(callback, conditionFunc, interval, timeout, extraInfo) {
  interval = interval || POLL_INTERVAL
  timeout = timeout || POLL_TIMEOUT
  extraInfo = extraInfo || ''
  let timer = null
  let startTime = Date.now()
  function poll() {
    if (conditionFunc()) {
      console.log('pollCondition wait success, conditionFunc return true, extraInfo:', extraInfo)
      clearInterval(timer)
    } else if (Date.now() - startTime > timeout) {
      console.log('pollCondition timeout, fallback to execute callback, extraInfo:', extraInfo)
      callback()
      clearInterval(timer)
    }
  }
  timer = setInterval(poll, interval)
}

