function getSpan(time) {
  time = time < 10 ? '0' + time : time
  return (
    '<span style="border-radius: 2px;padding: 0 4px;color: #F5F5F5;background-color: #707A8A; display: inline-block;">' +
    time +
    '</span>'
  )
}

function getimer(num) {
  if (num < 0) {
    window.location.href = usurl
  }
  var arr = []
  var a = Math.floor(num / 86400000)
  arr.push(getSpan(a))
  arr.push('D')
  num %= 86400000
  a = Math.floor(num / 3600000)
  arr.push(getSpan(a))
  arr.push('H')
  num %= 3600000
  a = Math.floor(num / 60000)
  arr.push(getSpan(a))
  arr.push('M')
  num %= 60000
  a = Math.floor(num / 1000)
  arr.push(getSpan(a))
  arr.push('S')
  return arr.join(' ')
}

